import React, {useEffect,useRef} from 'react';
import Rellax from "rellax";



const CV = () => {

  const rellaxRef = useRef();

  useEffect(() => {
    new Rellax(rellaxRef.current, {
      speed: 4,
      center: false,
      wrapper: null,
      round: true,
      vertical: true,
      horizontal: false
    });


  }, []);

  return (
    <div>
      <img src="" alt="" />

      <div>
        <img src="" alt="" />
      </div>


    </div>
  );
};

export default CV;
